import React, { Component } from "react";
import axios from "axios";
import "./NewPost.css";

class NewPost extends Component {
  state = {
    Batch_Year: "",
    Project_Name: "",
    Project_Supervisor: "",
    External_Supervisor: "",
    Co_Supervisor: "",
    Project_Id: "",
    Students: "",
  };

  postDataHandler = () => {
    const data = {
      Batch_Year: this.state.Batch_Year,
      Project_Name: this.state.Project_Name,
      Project_Supervisor: this.state.Project_Supervisor,
      External_Supervisor: this.state.External_Supervisor,
      Co_Supervisor: this.state.Co_Supervisor,
      Project_Id: this.state.Project_Id,
      Students: this.state.Students,
    };
    axios.post("record/", data).then((response) => {
      console.log(response);
    });
  };
  render() {
    return (
      <div className="NewPost">
        <h1>Add a Project</h1>
        <label>Batch_Year</label>
        <input
          type="text"
          value={this.state.Batch_Year}
          onChange={(event) =>
            this.setState({ Batch_Year: event.target.value })
          }
        />
        <label>Project_Name</label>
        <textarea
          value={this.state.Project_Name}
          onChange={(event) =>
            this.setState({ Project_Name: event.target.value })
          }
        />
        <label>Project_Supervisor</label>
        <input
          type="text"
          value={this.state.Project_Supervisor}
          onChange={(event) =>
            this.setState({ Project_Supervisor: event.target.value })
          }
        />
        <label>External_Supervisor</label>
        <input
          type="text"
          value={this.state.External_Supervisor}
          onChange={(event) =>
            this.setState({ External_Supervisor: event.target.value })
          }
        />
        <label>Co_Supervisor</label>
        <input
          type="text"
          value={this.state.Co_Supervisor}
          onChange={(event) =>
            this.setState({ Co_Supervisor: event.target.value })
          }
        />
        <label>Project_Id</label>
        <input
          type="text"
          value={this.state.Project_Id}
          onChange={(event) =>
            this.setState({ Project_Id: event.target.value })
          }
        />
        <label>Students</label>
        <input
          type="text"
          value={this.state.Students}
          onChange={(event) => this.setState({ Students: event.target.value })}
        />

        <button onClick={this.postDataHandler}>Project Submit</button>
      </div>
    );
  }
}

export default NewPost;
